import { generatePlainString, generateRdfResource, isObject, trimObject } from "../../../common/utils.js";

//#region src/namespaces/admin/generate/utils.ts
const generateFeed = (feed) => {
	if (!isObject(feed)) return;
	return trimObject({
		"admin:errorReportsTo": generateRdfResource(feed.errorReportsTo, generatePlainString),
		"admin:generatorAgent": generateRdfResource(feed.generatorAgent, generatePlainString)
	});
};

//#endregion
export { generateFeed };